The Statewide Poverty Action Network builds grassroots power to end causes of poverty and create opportunities for everyone to prosper. We envision a state where people of all income levels fully promote and participate in building the fabric of socially, politically, racially, and economically just communities.

We are directed by people with low incomes and people of color, ensuring accountability to the communities that are most directly impacted by the effects of poverty and inequity. Together with our 11,000 members across the state, Poverty Action:
* Develops and advocates for innovative public policy solutions that address the root causes of poverty;
* Registers, educates, and mobilizes voters from low-income communities and communities of color;
* Engages community members in advocating for the issues that impact their lives;
* Organizes community members through a racial and gender equity lens; and
* Cultivates leaders in low-income communities.
